const styles = {
    borderBottom: '2px solid #eee',
    background: '#fafafa',
    margin: '.75rem auto',
    padding: '.6rem 1rem',
    maxWidth: '500px',
    borderRadius: '7px'
};

export default ({income})=>{
    return(
        <div style={styles}>
        <h2>{income.from_where}</h2>
        <p>{income.amount}</p>

        </div>
    )
}
